import { useState } from "react";
import { useEffect } from "react";
function ContactUs() {
  return (
    <>
      <div className="container">
        <div className="row gap-3">
          <form action="" className="gap-3">
            <div className="name">
              <input
                type="text"
                name=""
                id=""
                placeholder="Name"
                className="form-control"
              />
            </div>
           .number
          </form>
        </div>
      </div>
    </>
  );
}
export default ContactUs;
